sql_decomposition.gold-sql:
SELECT a.*, monthnum - dense_rank() over (partition by oPerson_personID order by monthnum) as groupnum
    FROM cte1 a
),
cte3 AS (
    SELECT a.*, max(monthnum) over (partition by oPerson_personID, groupnum) as lastmonth, min(monthnum) over (partition by oPerson_personID, groupnum) as firstmonth
    FROM cte2 a
)
SELECT oPerson_hasPersonName, tickerSymbol, sDate
FROM cte3
WHERE lastmonth - firstmonth >= 2;
